import Accueil from './pages/Accueil'
import { BrowserRouter, Routes, Route, useParams } from "react-router-dom";

function App() {
  return (
    <AppContext.Provider
      value={{
        appContext: appContext,
        setAppContext: setAppContext
      }}
    >
      < BrowserRouter >
        <Routes>
          <Route path="/Accueil" element={<Accueil />} />
        </Routes>
      </BrowserRouter >

    </AppContext.Provider>
  )
};

export default App;
